import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
  return (
    <div className="App">
      <Container />
    </div>
  );
}
function Container() {
  return (
    <div className="container">
      <DevImg />
      <DevName />
      <BIO />
      <SkillsContainer />
      <Skills />
    </div>
  );
}

function DevImg() {
  return (
    <div className="image-wrapper">
      <img className="image" src="./images/image.jpg" alt="Developer" />
    </div>
  );
}

function DevName() {
  return (
    <header className="header-wrapper">
      <h1 className="header">Nono Piralishvili</h1>
    </header>
  );
}

function BIO() {
  return (
    <div className="bio-wrapper">
      <p className="bio">
        I'm fast learning, ambitious and hard working individual with high sense
        of responsibility. I'm always open to new challenges and strive for
        gaining new skills and experiences in various fields.
      </p>
    </div>
  );
}

function SkillsContainer() {}

function Skills() {}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
